INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (24, 4, 0.0, "カオリ（サマー）", 0.0, 24015, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 1, 4, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 10021, 0.0, 110501);
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (24, 1, 0.0, "カオリ（サマー）", 4.0, 24016, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 2, 4, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 10021, 0.0, 110501);
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (24, 4, 0.0, "カオリ（サマー）", 0.0, 24017, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 3, 4, "マジムンだらけで目が回るさ～！\nふらふらさ～！", 10021, 0.0, 110501);
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (24, 2, 0.0, "カオリ（サマー）", 5.2, 24018, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 4, 1, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 10021, 0.0, 110501);
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (24, 6, 0.0, "カオリ（サマー）", 4.2, 24019, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 5, 5, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 10021, 0.0, 110501);
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (24, 2, 0.0, "カオリ（サマー）", 0.0, 24020, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 6, 2, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 10021, 0.0, 110501);
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (24, 6, 0.0, "カオリ（サマー）", 6.4, 24021, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 7, 1, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 10021, 0.0, 110501);
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (24, 2, 0.0, "カオリ（サマー）", 0.0, 24022, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 8, 2, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 10021, 0.0, 110501);
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (24, 3, 0.0, "カオリ（サマー）", 10.08, 24023, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 9, 6, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 10021, 0.0, 110501);
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (24, 2, 0.0, "カオリ（サマー）", 5.0, 24024, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 10, 1, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 10021, 0.0, 110501);
INSERT INTO `v1_68c8373c6878d2dd897a7c8507d2debb8c3fe325cb30b6c114628d19e42fc9a3` VALUES (24, 2, 0.0, "カオリ（サマー）", 0.0, 24025, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 11, 2, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 10021, 0.0, 110501);
